import { useEffect, useState } from "react";

function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetch("http://localhost:4000/api/admin/orders", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          setOrders([]);
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error("Admin fetch error:", err);
        setLoading(false);
      });
  }, [token]);

  if (loading) return <div className="container mt-4">Loading...</div>;

  return (
    <div className="container mt-4">
      <h2 className="mb-4" style={{ fontWeight: "bold", color: "#333" }}>
        📦 Admin Dashboard
      </h2>

      {orders.length === 0 ? (
        <p>No orders found.</p>
      ) : (
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(auto-fit, minmax(350px, 1fr))",
            gap: "20px",
          }}
        >
          {orders.map((o) => (
            <div
              key={o._id}
              style={{
                border: "1px solid #ddd",
                borderRadius: "12px",
                padding: "20px",
                boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
                background: "#fff",
              }}
            >
              {/* Customer Info */}
              <h4 style={{ marginBottom: "10px", color: "#007bff" }}>
                {o.customerName || "Guest"}{" "}
                <span style={{ fontSize: "14px", color: "#666" }}>
                  ({o.customerEmail})
                </span>
              </h4>
              <p style={{ margin: "5px 0", fontSize: "14px", color: "#444" }}>
                📱 {o.customerPhone}
              </p>
              <p style={{ margin: "5px 0", fontSize: "14px", color: "#444" }}>
                🏠 {o.customerAddress?.line1}, {o.customerAddress?.city},{" "}
                {o.customerAddress?.postal_code}
              </p>

              {/* Ordered Items */}
              <div style={{ marginTop: "15px" }}>
                <h6 style={{ fontWeight: "bold" }}>🛒 Ordered Products:</h6>
                <ul style={{ paddingLeft: "20px", marginTop: "10px" }}>
                  {Array.isArray(o.items) &&
                    o.items.map((p, i) => (
                      <li key={i} style={{ fontSize: "14px" }}>
                        {p.name} (x{p.quantity}) –{" "}
                        <span style={{ fontWeight: "bold" }}>₹{p.price}</span>
                      </li>
                    ))}
                </ul>
              </div>

              {/* Price & Session */}
              <div
                style={{
                  marginTop: "15px",
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  fontSize: "14px",
                }}
              >
                <p style={{ fontWeight: "bold", color: "green" }}>
                  💰 Total: ₹{o.totalAmount}
                </p>
                <p style={{ fontSize: "12px", color: "#888" }}>
                  {new Date(o.createdAt).toLocaleString()}
                </p>
              </div>

              <p
                style={{
                  fontSize: "12px",
                  wordBreak: "break-word",
                  color: "#999",
                  marginTop: "10px",
                }}
              >
                🔑 Session ID: {o.stripeSessionId}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default AdminDashboard;
